import React from "react";
import "./App.css";
import { Link } from "react-router-dom";
import ReactPlayer from "react-player";

function Video() {
  return (
    <div className="vid">
      <ReactPlayer url="https://www.youtube.com/watch?v=kOyPsl0bI1g" />
    </div>
  );
}

export default Video;
